  let quantity = [req.body.quantity, req.body.productName]
  db.updateQuantity(quantity, (err, result)=>{
    if (err){
      res.send(err)
    } else {
      res.send(result)
    }
  })
})
app.get('/getOrders', (req, res)=>{
  db.getOrders((err, result)=>{
    console.log("RESULTTTTT1", result)
